def createDBsubs():
    db = sqlite3.connect('database_test.db')
    cursor = db.cursor()
    cursor.execute("CREATE TABLE subs(nom TEXT, créé_par INTEGER, numéro_projet INTEGER PRIMARY KEY AUTOINCREMENT, mots_clés TEXT, description TEXT, création DATE,FOREIGN KEY(créé_par) REFERENCES utilisateurs(id_user));")
    db.commit()
    db.close()

def createDButilisateurs():
    db = sqlite3.connect('database_test.db')
    cursor = db.cursor()
    cursor.execute("CREATE TABLE utilisateurs(id_user INTEGER PRIMARY KEY AUTOINCREMENT, nom TEXT, prénom TEXT,niveau VARCHAR(1), mail TEXT, mdp TEXT) ")
    db.commit()
    db.close()


def recommandation(id):
    subs = sqlite3.connect('database_test.db')
    cursor = subs.cursor()
    query='''SELECT Nom,Mots_clés FROM subs WHERE Numéro_projet=?'''
    cursor.execute(query,(id,))
    L=cursor.fetchall()
    query='''SELECT Numéro_projet,Nom,Mots_clés FROM subs WHERE NOT Numéro_projet=?'''
    cursor.execute(query,(id,))
    L2=cursor.fetchall()
    mots=L[0][1].split(' ')+L[0][0].split(' ')
    numero_projet=[]
    ban_list=['de','le','la','les','un','une','des','je','tu','il','nous','vous','ils','elle','elles','on','au','aux','à',' ','']
    for i in range(len(L2)):
        id=int(L2[i][0])
        comp=0
        temp=L2[i][1].split(' ')+L2[i][2].split(' ')
        for mot in mots:
            if mot not in ban_list:
                if mot in temp:
                    comp+=1
        numero_projet.append((id,comp))
    numero_projet.sort(key=lambda x:x[1],reverse=1)
    subs.close()
    return numero_projet

def rempliruser():
    cursor.execute("DROP TABLE IF EXISTS utilisateurs")
    db.commit()
    createDButilisateurs()
    alphabet = string.ascii_letters + string.digits
    for i in range(len(mail)):
        cursor.execute("INSERT INTO utilisateurs(nom,prénom,mail,niveau,mdp) VALUES(?,?,?,?,?)",(nom[i],prenom[i],mail[i],random.choice(niveau),''.join(random.choice(alphabet) for i in range(12))))
        db.commit()

def remplirsubs(n,y):
    cursor.execute("DROP TABLE IF EXISTS subs")
    db.commit()
    createDBsubs()


    alphabet = string.ascii_letters + string.digits

    for i in range(n):
        titre=''
        desc=''
        mc=''
        for i in range(y*10):
            titre+=' '+random.choice(motfr)
        for i in range(300):
            desc+=' '+random.choice(motfr)
        for j in range(y*10):
            mc+=' '+random.choice(motfr)
        cursor.execute("INSERT INTO subs(nom,créé_par,description,mots_clés,création) VALUES(?,?,?,?,?)",(titre,random.randint(1,20),desc,mc,str(random.randint(2018,2021))+'-'+str(random.randint(1,12))+'-'+str(random.randint(1,28))))
        db.commit()

